INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8711533032056', 'Coppa et emmental', 'Pain de mie aux céréales 52.6 % : Farines de _blé_ et d\'_orge_ malté torréfié, eau, céréales 5.5 % (flocons de _blé_ malté, graines de lin brun, flocons de seigle malté), huile de colza, sucre, levure, sel, émulsifiant : mono- et diglycérides d\'acides gras, _gluten_ de blé. Coppa au sel sec 18.4% : échine de porc origine UE, sel sec, dextrose, sirop de glucose, arômes naturels, épices, ail, sucre, conservateurs : lactate et acétate de sodium, ascorbate de sodium, acide ascorbique, nitrate de potassium, nitrite de sodium, ferments, Sauce au _yaourt_ et aux herbes 15.8% : huile de colza, eau, _yaourt_ 7%, vinaigre, amidon transformé de pomme de terre, sucre, poudre de jaune d\'_œuf_, sel, herbes de Provence 0,1%, stabilisants : farine de graines de caroube et gomme xanthane, conservateur : sorbate de potassium. _Emmental_ 7.9%. Salade 5.3%.', 'https://static.openfoodfacts.org/images/products/871/153/303/2056/front_fr.4.400.jpg', '13.2', '2.8', '25.9', '2.7', '0', '11.6', '2.1', '0.826771653543307', '', '0');

