VALUES ('8711533032087', 'Jambon et mozzarella', 'Pain de mie au pavot 42.1 % : Farine de blé, eau, huile de colza, levure, sucre, sel, graines de pavot (1,2%), émulsifiant : mono et diglycérides d\'acides gras, gluten de blé, farine de fèves. Jambon cuit supérieur 21,1% : jambon de porc origine UE, eau, sel, dextrose, arômes, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Sauce au pesto 14.2% : fromage blanc, huile de colza, eau, vinaigre, basilic, amidon transformé de pomme de terre, huile d\'olive vierge extra, sel, moutarde de Dijon (eau, graine de moutarde, vinaigre, sel, acidifiant : acide citrique, conservateur : disulfite de potassium), jaune d\'œuf, sucre, jus de citron concentré, parmesan, pignons de pin, épaississants : gomme guar et gomme xanthane, conservateur : sorbate de potassium, ail, épice. Tomate 10,5%. Mozzarella 6.8%. Salade 5,6%,', 'https://static.openfoodfacts.org/images/products/871/153/303/2087/front_fr.4.400.jpg', '7.8', '1.6', '22', '2.5', '', '10', '1.4', '0.551181102362205', '', '0');

