VALUES ('8711533032100', 'Sandwich jambon fumé & comté', 'Pain spécial de campagne 50%: farine de blé, eau, levure, gluten de blét dextrose, farine d\'orge malté toasté, remoulage de blé, sucre, farine extrait d\'acérola. Jambon cuit choix fumé 22.7%: jambon de porc origine UE, eau, sel, dextrose, sirop de glucose, arômes, stabilisants E451-E450, antioxydant: érythorbate de sodium, conservateur: nitrite de sodium. Sauce au fromage blanc 11.4%: fromage blanc 4.6%, huile de colza, eau, vinaigre, amidon transformé de pomme de terre, jaune d\'œuf, sucre, moutarde de Dijon (eau, graines de moutarde, vinaigre, sel, acidifiant: acide citrique, antioxydant: disulfite de potassium), sel, épaississants: gomme de guar et gomme de xanthane, conservateur: sorbate de potassium. Comté 9.1%. Salade 6.8%. Traces éventuelles de poisson, crustacé, sésamey céleri, soja, fruits à coque. Informations en gras destinées aux personnes allergiques.', 'https://static.openfoodfacts.org/images/products/871/153/303/2100/front_fr.4.400.jpg', '7', '2.3', '30.9', '2.2', '', '12', '1.7', '0.669291338582677', '', '0');

